  contact_id SERIAL PRIMARY KEY,
  firstName varchar(255) default NULL,
  lastname varchar(255) default NULL,
  address varchar(255) default NULL,
  postcode varchar(10) default NULL,
  city varchar(255),
  phonenumber varchar(100) default NULL
);

